import React, { Component } from 'react';
import {Badge, Card, CardBody, Col, Row} from 'reactstrap';
import DatePicker from "react-datepicker";

class Fdates extends Component {

    constructor(props) {
        super(props);
        this.state = {
          startDate: new Date(),
          endDate: new Date()
        };

        this.handleChange = date => {
          this.setState({
            startDate: date,
            endDate:date
          });
        }
      }
    render() {
        return (

        <div className="animated fadeIn">

                <br />  

                <strong>Get Reports Weekly/ Monthly Wise</strong><br/>
                <hr/>
                <div className="dates">
                  <strong> To:&nbsp;</strong> <DatePicker className = "start_date" maxDate={this.state.startDate} selected={this.state.startDate} onChange={this.handleChange}/>

                  <strong>&nbsp;&nbsp;&nbsp; Form:&nbsp;</strong> <DatePicker className = "end_date"  selected={this.state.endDate} />
                 &nbsp;&nbsp;&nbsp;<Badge className="mr-3" color="warning"><i class="fa fa-pencil fa-lg"></i>  Apply  </Badge>
                 </div>
                <hr/>


      </div>

        );
    }
}
export default Fdates;
